import React from 'react'
import './heading.css';
import me from '../res/me.png';

function Header() {
  return (
    <header className='background'>
      <div className='box'>
        <img src={me} className='stanley'/>
        <p className='intro'>HI. I'M STANLEY.<br/>I'M A PASSIONATE SOFTWARE DEVELOPER.</p>
        <p></p>
      </div>
    </header>
  );
};

export default Header
